import React from 'react'
import '@mobiscroll/react/dist/css/mobiscroll.min.css';

import 'semantic-ui/dist/semantic.min.css';


class Managermain2 extends React.Component {
    render() {
        return (
            <mobiscroll.Form theme="ios">
                <mobiscroll.FormGroup>
                    <mobiscroll.FormGroupTitle>Button colors</mobiscroll.FormGroupTitle>
                    <div className="mbsc-btn-group">
                        <mobiscroll.Button color="primary">Primary</mobiscroll.Button>
                        <mobiscroll.Button color="secondary">Secondary</mobiscroll.Button>
                        <mobiscroll.Button color="success">Success</mobiscroll.Button>
                        <mobiscroll.Button color="danger">Danger</mobiscroll.Button>
                        <mobiscroll.Button color="warning">Warning</mobiscroll.Button>
                        <mobiscroll.Button color="info">Info</mobiscroll.Button>
                        <mobiscroll.Button color="light">Light</mobiscroll.Button>
                        <mobiscroll.Button color="dark">Dark</mobiscroll.Button>
                    </div>
                </mobiscroll.FormGroup>
            </mobiscroll.Form>
                )
                }
                }
            export default Managermain2
